import * as React from "react";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Box from "@mui/material/Box";
import styled from "@emotion/styled";
import { THEME } from "../constants/Theme";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import SwipeableViews from "react-swipeable-views";
import { Grid, Typography } from "@mui/material";
import PropTypes from "prop-types";
import { useTheme } from "@emotion/react";
import Recommendation from "./Recommendation";
import AyamPangsit from "../assets/product/AyamPangsit.png";
import { useNavigate } from "react-router-dom";
import { AppContext } from "../App";

function TabPanel(props) {
  const { children, value, index, ...other } = props;
  

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

const themeColor = createTheme({
  palette: {
    primary: {
      main: THEME.GREEN_PRIMARY,
    },
  },
});

const CustomTab = styled(Tab)({
  textTransform: "none",
  color: THEME.GREY_PRIMARY,
  fontWeight: 600,
  fontSize: "12px",
});

export default function StyledTabs() {
  const [value, setValue] = React.useState(0);
  const navigate = useNavigate();
  const {
    APIFoods
  } = React.useContext(AppContext);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const theme = useTheme();

  const handleChangeIndex = (index) => {
    setValue(index);
  };

  return (
    <ThemeProvider theme={themeColor}>
      <Box sx={{ maxWidth: { xs: 320, sm: 480 }, bgcolor: "background.paper" }}>
        <Tabs
          value={value}
          onChange={handleChange}
          variant="scrollable"
          scrollButtons={false}
          aria-label="scrollable prevent tabs example"
          TabIndicatorProps={{ style: { background: THEME.GREEN_PRIMARY } }}
          textColor="primary"
        >
          <CustomTab label="Sayuran" />
          <CustomTab label="Lauk" />
          <CustomTab label="Bumbu" />
          <CustomTab label="Sup" />
          <CustomTab label="Desert" />
          <CustomTab label="Minuman" />
        </Tabs>
        <SwipeableViews
          axis={theme.direction === "rtl" ? "x-reverse" : "x"}
          index={value}
          onChangeIndex={handleChangeIndex}
        >
          <TabPanel value={value} index={0} dir={theme.direction}>
          
            <Grid
              container
              rowSpacing={2}
              columnSpacing={{ xs: 0, sm: 0, md: 0 }}
              sx={{ width: "443px", ml: "-20px" }}
            >
              {typeof APIFoods == "object"
                  ? Object.keys(APIFoods).map((foods, i) => (
                      <>
                       <Grid item xs={6} sx={{}}>
                <Recommendation
                  tabs
                  title={APIFoods[i].f_name}
                  discount={20}
                  price={"25000"}
                  rating="5.0"
                  sold="809"
                  image={AyamPangsit}
                  onClick={() => navigate("/product")}
                />
              </Grid>
                      </>
                    ))
                  : ""}
              <Grid item xs={6} sx={{}}>
                <Recommendation
                  tabs
